import './../Style/Shop.css';
import AppShopItem from './ShopItem';
import shopItemData from '../Data/ShopItemData';
import { useState, useEffect } from 'react';
import AppSearch from './Search';
import AppNotfound from './Notfound';
import {
    Link,
    Navigate 
} from "react-router-dom";
import {variables} from "../Variables";




function AppShop(){
    const [searchText,setSearchText] = useState('');
    const [shop, setShop] = useState([]);

    useEffect(() => {
        fetch(variables.API_URL+"get_shop", {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setShop(result);
            }
        )
    }, []);

    const filterShopItem = shopItemData.filter((shopItem) =>{
        return shopItem.shop_name.includes(searchText)
    });

    const ShopItemElements = filterShopItem.map((shopItem, index) =>{
        return <AppShopItem key={index} shopItem={shopItem}/>
    });
    
    return(
        <div className='Shop'>
            <div className='menu_shop_content'>
                <Link to='/Shop'>
                    <div className='menu_shop active_menu'>
                        <i className="fa-solid fa-shop"></i>
                        <p>Shop</p>
                    </div>
                </Link>
                <Link to='/Model'>
                    <div className='menu_shop' >
                        <i className="fa-sharp fa-solid fa-user-tie"></i>
                        <p>Model</p>
                    </div>
                </Link>
            </div>

            <AppSearch value={searchText} onValueChange={setSearchText}/>
            <div className='Category-list'>
                <div className='Category-menu'><div className='Category-img'><img className="Category-active" src='../img/Eyelash extensions.png' alt=''></img></div><div>Eyelash extensions</div></div>
                <div className='Category-menu'><div className='Category-img'><img src='../img/Hair salon.png' alt=''></img></div><div>Hair salon</div></div>
                <div className='Category-menu'><div className='Category-img'><img src='../img/Spa salons.png' alt=''></img></div><div>Spa salons</div></div>
                <div className='Category-menu'><div className='Category-img'><img src='../img/Nail salons.png' alt=''></img></div><div>Nail salons</div></div>
                <div className='Category-menu'><div className='Category-img'><img src='../img/Beauty salons.png' alt=''></img></div><div>Beauty salons</div></div>
            </div>
            <div className='item_shop_content'>
                {ShopItemElements.length === 0 ? <AppNotfound value="ไม่พบร้านเสริมสวย"/>:ShopItemElements}
            </div>
           
        </div>

    );
}

export default AppShop;
